import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";
import silver_1 from "../../images/silver_1.png"
import gold_1 from "../../images/gold_1.png"
import {
  ComposedChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';
import Navigation from "../Navigation";
const Summoner = (props, context) => (
  <div>
  <Navigation/>
  <div className={styles.summoner}>
      <div className={styles.box}>
        
        <div className={styles.top}>
        {!props.loading &&(
          <div className={styles.showmmr} >
         
            <div className={styles.name}>{props.mmr[0].summoner_name}'s MMR</div>
         
          
            <div className={styles.warning}>※ 솔로 랭크 기준으로 계산됩니다. 듀오 게임이 많은 경우 부정확 할 수 있습니다. ※ </div>
            
            <div className={styles.tier}>
              <div className={styles.right}>
                <img
                    src={silver_1}
                    alt={"Logo"}
                    className={styles.logo}
                  />
                <div className={styles.mmrtotier}>
                  MMR TO TIER : Silver 1 85LP
                </div>  
                <div className={styles.mmr}>
                  MY MMR : 1330
                </div>
                
              </div>
            </div>
            <div className={styles.explain}>티어 평균 MMR보다 10 높습니다.</div>
            <div className={styles.chartdiv}>
              <div className={styles.title}>MMR 변화 그래프</div>
              <ComposedChart
                width={500}
                height={300}
                data={props.data}
                className={styles.chart}
              >
              
                <XAxis dataKey="date" tickLine={false} />
                <YAxis domain={['auto', 'auto']} mirror />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="mmr" stroke="#E4373C" activeDot={{ r: 8 }} />
              </ComposedChart>
            </div>
             

            
            
          </div>
         )}  
          </div>
       
      </div>
  </div>
  </div>
);

Summoner.propTypes = {
  data : PropTypes.array.isRequired,
  summonername : PropTypes.string.isRequired,
  mmr : PropTypes.array.isRequired,
};

export default Summoner;
